import React from 'react';
import { BrowserRouter } from 'react-router-dom';

const App: React.FC = () => {
  return (
    <BrowserRouter>
      <div className="App">
        <h1>Side Project</h1>
      </div>
    </BrowserRouter>
  );
}

export default App;
